.grid-container{
    background:#eee;
    /*Below is the max pixels in width */
    max-width: 900px;
    margin:0auto;
    display:grid;
    /*creates a gap of 50 pixels */
    gap:30px 100px;
    /* Below specifies that each column for each row is 300 px each*/
    /*repeat(6,1fr) 6 is the argument for how many blocks you want in the grid*/
    /* 1fr stands for 1 fraction of the avaliable space max being 900px. It divides the grid container into equal fractions. */
    grid-template-columns:repeat(6,1fr);
}
   

/*Below is a CSS selector that is targeting all the <div> elements that are direct children with the class .grid-container*/
/*'.grid-container' is targeting elements with the same name grid-container. In the index.html file <div class="grid-container" 
 is the thing that has grid-container >*/
 /*> is the child combinator selector in CSS, this selects on the the direct children of the specified element.*/
 /*div is the element selector, specifiying that the code is targeting <div> elements.*/

    
.grid-container > div{
    background:#CCC;
    text-align:center;
    padding:20px;
    border: 1px solid black;
}
/*div:nth-child is a pseudo child selector that tells the code to look at the specific child and then modify it */
/*in this case this is targeting the first child of grid container. */
.grid-container > div:nth-child(1){
    grid-column: 1/ span 2;
    /*1/span2 this is telling the computer starting at column 1 the 
    the selected child is going to have a span of 2 columns*/
}
.grid-container > div:nth-child(2){
    grid-column: 2/ span 2; /*This is selecting the second child, starting it at column 2 and giving it the span of 2 columns*/
}

using System;

namespace Ijunior
{
    internal class Program
    {
        static void Main(string[] args)
        {
            int health = 4;
            int totalHealth = 10;
            int mana = 6;
            int totalMana = 10;
            int healthBarPosition = 0;
            int manaBarPosition = 1;


            DrawBar(health, totalHealth, healthBarPosition);
            DrawBar(mana, totalMana, manaBarPosition);
        }

        static void DrawBar(int value, int totalValue, int barPosition)
        {
            char openFrame = '[';
            char closeFrame = ']';
            char barFilling = '#';
            char barEmpty = ' ';

            Console.SetCursorPosition(0, barPosition);
            Console.Write(openFrame);

            for (int i = 0; i < value; i++)
            {
                Console.Write(barFilling);
            }

            for (int i = value; i < totalValue; i++)
            {
                Console.Write(barEmpty);
            }

            Console.Write(closeFrame);
            Console.WriteLine();
        }
    }
}

import SwiftUI
import UIKit

struct ContentView: View {
    var body: some View {
        VStack {
            Text("it works")
            
            LinkedTextView(
                text: "I have a Link and another Link2 ahds jadjsah dhjasjhdsa j jdas d asj dsjhd jadhjadshjd ",
                links: ["Link": "https://google.gl", "Link2": "https://bing.com"],
                onLinkTapped: { url in
                    print("\(url.absoluteString) tapped")
                }
            )
            Text("it works")
        }
    }
}

struct LinkedTextView: View {
    // Your text from the server
    let text: String
    
    // Your dictionary with links
    let links: [String: String]
    
    let onLinkTapped: (_ url: URL) -> Void
    
    @Environment(\.openURL) private var openURL
    
    var body: some View {
        Text(makeAttributedString())
            .font(.title)
            .environment(\.openURL, OpenURLAction(handler: handleURL))
    }
    
    func handleURL(_ url: URL) -> OpenURLAction.Result {
        // - Use .handled if you've performed a custom action
        // - Use .discarded if you weren't able to handle the link
        if UIApplication.shared.canOpenURL(url) {
            onLinkTapped(url)
            return .handled
        }
        return .discarded
    }
    
    func makeAttributedString() -> AttributedString {
        var attributedString = AttributedString(text)
        // Iterate through the dictionary and add link attributes
        for (key, value) in links {
            if let range = attributedString.range(of: key) {
                // Define the URL attribute
                attributedString[range].link = URL(string: value)
                
                // Apply different text style for the links
                attributedString[range].foregroundColor = .blue
                attributedString[range].underlineStyle = .single
                attributedString[range].font = .caption
            }
        }
        
        return attributedString
    }
}

