    {
        static void Main(string[] args)
        {
            int arrayCapacity = 10;
            int[] numbers = new int[arrayCapacity];
            Random random = new Random();
            int lessNumberForRandom = 1;
            int topNumberForRandom = 10;
            int userInput;
            int shift;
            int tempNumber;

            for (int i = 0; i < numbers.Length; i++)
            {
                numbers[i] = random.Next(lessNumberForRandom, topNumberForRandom);
                Console.Write(numbers[i] + " ");
            }

            Console.Write("\n–ù–∞ —Å–∫–æ–ª—å–∫–æ —Å–¥–≤–∏–Ω—É—Ç—å –º–∞—Å—Å–∏–≤: ");
            userInput = Convert.ToInt32(Console.ReadLine());
            shift = userInput % numbers.Length;

            for (int i = 0; i < shift; i++)
            {
                tempNumber = numbers[0];

                for (int j = 0; j < numbers.Length - 1; j++)
                {
                    numbers[j] = numbers[j + 1];
                }

                numbers[numbers.Length - 1] = tempNumber;
            }

            for (int i = 0; i < numbers.Length; i++)
            {
                Console.Write(numbers[i] + " ");
            }
        }
    }
}

